import React, { useState, useEffect } from 'react';

export default function Test(){

    const [currentSet, setCurrentSet] = useState([]);
    useEffect(() => {
        fetch('http://127.0.0.1:5000/index2').then(res => res.json()).then(data => {
            setCurrentSet(data.sets);
            console.log(data.set)

        });
      }, []);

      const listItems = currentSet.map((number) =>
      <div>
      <li key={number.toString()}>
        {number}
      </li>
      </div>
    );
    return(
        <div>
        <h1>xD</h1>
        <ul>{listItems}</ul>
        </div>
    );
}
